import {useState} from 'react'

function Home() {
  return <div>Home 2</div>
}

const Contador = () => {
  const [contador, setContador] = useState(1)

  adicionarContador = () => {
    setContador(contador + 1)
  }

  return (
    <div>
      <div>{contador}</div>
      <button onClick={adiocionarContador}>Adicionar</button>
    </div>
  )
}

export default Home
